summary:
* Intern Project management and Communication
Regional Environmental Center for Central and Eastern Europe - Bulgaria, Sofia (Bulgaria)
Assisting in project management and reporting - preparation of technical and financial report content; Communication with managing authorities; Project communication and visibility - preparation of project-related articles, publications, communication & dissemination plans; Assisting in organizing of project events - preparation of invitations, list of participants, taking pictures during the event, preparation of news and press releases; Part of the fieldwork team of Adopt the River Project - work with students on river monitoring, part of the team who organized Artwork competition - awarding ceremony, under the same project;

* Intern Journalist/PR specialist - PM Studios, Veliko Tarnovo (Bulgaria)
The internship was awarded and sponsored by the Ministry of Education and Science, Bulgaria.
- preparation of news content - articles, interviews, and PR campaign preparation; preparation of press releases;

* Intern Communication and Social Media
Regional Economic Development Agency, Stara Zagora (Bulgaria)
Overview and analysis of the website of the organization - preparation of plan how the web content and structure can be optimized; Overview and analysis of social media accounts their content, target groups, impact - preparation of short report and steps how the content can be optimized and improved;
Assisting in day-to-day project management tasks; Creating online content - web and social media articles/posts, related to project events;
